import SpotifyPlayer from 'react-spotify-player';

const array = ['spotify:artist:6noxsCszBEEK04kCehugOp', 'spotify:artist:3WYT2b8pOLsLsqSaoWYr7U'];

const players = array.map(ele => {
  return(
    <SpotifyPlayer
        uri='spotify:artist:6noxsCszBEEK04kCehugOp'
        size={{
          width: '20%',
          height: 300,
        }}
        view={'list'}
        theme={'black'}
      />
  );
});

const player = () => {
  return (
    <div>
      <SpotifyPlayer
        uri='spotify:artist:6noxsCszBEEK04kCehugOp'
        size={{
          width: '20%',
          height: 300,
        }}
        view={'list'}
        theme={'black'}
      />
      <SpotifyPlayer
        uri='spotify:artist:3WYT2b8pOLsLsqSaoWYr7U'
        size={{
          width: '20%',
          height: 300,
        }}
        view={'list'}
        theme={'black'}
      />
    </div>
  );
};
export default player;
